getDataFogos();
//getDataNasaVIIRS();
//getDataNasaMODIS();
initializeFires();
var FogosAlerts_Layer;
var entry;
var nasaVIIRS;
var nasaMODIS;


function getDataFogos(){
    $.getJSON("https://external.wazept.com/getFogos.php", function(data) {
        entry = data.data;
    });
}

function getDataNasaVIIRS(){
    $.getJSON("https://external.wazept.com/fire/getNasaVIIRS.php", function(data) {
        nasaVIIRS = data;
    });
}

function getDataNasaMODIS(){
    $.getJSON("https://external.wazept.com/fire/getNasaMODIS.php", function(data) {
        nasaMODIS = data;
    });
}

function checkLayerNum()
{
    var lmaoLayer = null;
    for(var i = 0; i < W.map.layers.length; i++)
    {
        if(W.map.layers[i].uniqueName == '__fogos_alerts') lmaoLayer = i;
    }
    return lmaoLayer;
}

function getFogosAlerts(){
    if (!FogosAlerts_Layer.getVisibility()) {
        return;
    }
    FogosAlerts_Layer.destroyFeatures();
    $(entry).each(function(){
        var lat = this.lat;
        var long = this.lng;
        addImage("fogos", lat, long, this);
    });
    /*$(nasaVIIRS).each(function(){
        var lat = parseFloat(this.latitude);
        var long = parseFloat(this.longitude);
        console.log(lat);
        console.log(long);
        addImage("VIIRS", lat, long, this);
    });
    $(nasaMODIS).each(function(){
        var lat = parseFloat(this.latitude);
        var long = parseFloat(this.longitude);
        addImage("MODIS", lat, long, this);
    });*/
}

function addImage(type, lat, long, detail) {
    let epsg900913 = new OpenLayers.Projection("EPSG:900913");
    let epsg4326 = new OpenLayers.Projection("EPSG:4326");

    var point = new OL.Geometry.Point(long,lat).transform(epsg4326, epsg900913);
    var alertPx = W.map.getPixelFromLonLat(new OL.LonLat(long,lat));
    var icon;
    var attributes;
    var style;
    if(type == "fogos"){
        icon = 'data:image/png;base64,';
        attributes = {
            type: "fogos",
            status: detail.status,
            date: detail.date,
            hour: detail.hour,
            important: detail.important,
            man: detail.man,
            terrain: detail.terrain,
            aerial: detail.aerial,
            estradas: detail.PontoSituacao,
            pixel: alertPx
        };
        style = {
            externalGraphic: icon,
            graphicWidth: 32,
            graphicHeight: 38,
            title: 'Fogos',
            cursor: 'help'
        };
    }
    else if(type == "VIIRS" || type == "MODIS"){
        icon = 'data:image/png;base64,';
        attributes = {
            type: type,
            acq_date: detail.acq_date,
            acq_time: detail.acq_time.substring(0, 2) + ':' + detail.acq_time.substring(2, 4),
            confidence: detail.confidence,
            pixel: alertPx
        };
        style = {
            externalGraphic: icon,
            graphicWidth: 16,
            graphicHeight: 19,
            title: 'Fogos',
            cursor: 'help'
        };
    }
    var imageFeature = new OL.Feature.Vector(point, attributes, style);
    FogosAlerts_Layer.addFeatures([imageFeature]);
}

function initializeFires(e)
{
    if (e && e.user === null) {
        return;
    }
    if (typeof W === "undefined" || typeof W.loginManager === "undefined" || typeof W.map === 'undefined' || typeof OL === 'undefined' || document.querySelector('.list-unstyled.togglers .group') === null) {
        setTimeout(initializeFires, 100);
        return;
    }
    if (!W.loginManager.user) {
        W.loginManager.events.register("login", null, initializeFires);
        W.loginManager.events.register("loginStatus", null, initializeFires);
        if (!W.loginManager.user) {
            return;
        }
    }
    function showAlertPopup(f, x, y){
        divFogos.style.bottom = (document.documentElement.scrollHeight - y - 25) + 'px';
        divFogos.style.left = x + 'px';
        var attributes = f.attributes;
        var reportDetail;
        if(attributes.type == "fogos"){
            reportDetail = "<b>Incêndio</b>" +
                "<br>Estado: " + attributes.status +
                "<br>Data: " + attributes.date +
                "<br>Hora: " + attributes.hour +
                "<br>Importante: " + attributes.important +
                "<br>Operacionais: " + attributes.man +
                "<br>Terrestres: " + attributes.terrain +
                "<br>Aereos: " + attributes.aerial;
            if(typeof attributes.estradas === 'undefined')
                reportDetail = reportDetail + "<br>Estradas: N/A";
            else
                reportDetail = reportDetail + "<br>Estradas: " + attributes.estradas;
        }
        else if(attributes.type == "VIIRS"){
            reportDetail = "<b>Ponto Quente (VIIRS)</b>" +
                "<br>Data: " + attributes.acq_date +
                "<br>Hora: " + attributes.acq_time +
                "<br>Confiança: " + attributes.confidence;
        }
        else if(attributes.type == "MODIS"){
            reportDetail = "<b>Ponto Quente (MODIS)</b>" +
                "<br>Data: " + attributes.acq_date +
                "<br>Hora: " + attributes.acq_time +
                "<br>Confiança: " + attributes.confidence + "%";
        }
        document.getElementById("divFogos").innerHTML = reportDetail;
        divFogos.style.visibility = 'visible';
    }

    function hideAlertPopup(){
        divFogos.style.visibility = 'hidden';
    }

    function saveLMAOOptions() {
        if (localStorage) {
            var options = [];
            fogosVisibility = document.getElementById("layer-switcher-item_fogos_alerts").checked;
            options[0] = fogosVisibility;
            localStorage.setItem("WMEFogosAlerts", JSON.stringify(options));
        }
    }

    function registerKeyShortcut(actionName, callback, keyName) {
        I18n.translations[I18n.locale].keyboard_shortcuts.groups['default'].members[keyName] = actionName;
        W.accelerators.addAction(keyName, {group: 'default'});
        W.accelerators.events.register(keyName, null, callback);
        W.accelerators._registerShortcuts({[""]: keyName});
    }

    var fogosVisibility = true;
    FogosAlerts_Layer = new OL.Layer.Vector("Fogos Alerts",{
        rendererOptions: { zIndexing: true },
        uniqueName: '__fogos_alerts'
    }												 );
    if (localStorage.WMEFogosAlerts) {
        var options = JSON.parse(localStorage.getItem("WMEFogosAlerts"));
        fogosVisibility = options[0];
    }
    window.addEventListener("beforeunload", saveLMAOOptions, false);
    var otherGroupSelector = document.getElementById('layer-switcher-group_display');
    if (otherGroupSelector !== null) {
        var otherGroup = otherGroupSelector.parentNode.parentNode.parentNode.parentNode.getElementsByTagName("UL")[0];
        var toggler = document.createElement('li');
        var togglerContainer = document.createElement('div');
        togglerContainer.className = 'wz-checkbox';
        var checkbox = document.createElement('input');
        checkbox.type = 'checkbox';
        checkbox.id = 'layer-switcher-item_fogos_alerts';
        checkbox.className = 'toggle';
        checkbox.checked = FogosAlerts_Layer.getVisibility();
        checkbox.addEventListener('click', function(e) {
            FogosAlerts_Layer.setVisibility(e.target.checked);
        });
        otherGroupSelector.addEventListener('click', function(e) {
            FogosAlerts_Layer.setVisibility(e.target.checked & checkbox.checked);
            checkbox.disabled = !e.target.checked;
        });
        togglerContainer.appendChild(checkbox);
        var label = document.createElement('label');
        label.htmlFor = checkbox.id;
        var labelText = document.createElement('span');
        labelText.className = 'label-text';
        labelText.appendChild(document.createTextNode("Fogos Alerts"));
        label.appendChild(labelText);
        togglerContainer.appendChild(label);
        toggler.appendChild(togglerContainer);
        otherGroup.appendChild(toggler);
    }
    W.map.addControl(new OL.Control.DrawFeature(FogosAlerts_Layer, OL.Handler.Path));
    W.map.addLayer(FogosAlerts_Layer);
    FogosAlerts_Layer.setVisibility(fogosVisibility);
    getFogosAlerts();
    var divPopupCheck = document.getElementById('divFogos');
    if (divPopupCheck === null){
        var divFogos = document.createElement('div');
        divFogos.id = "divFogos";
        divFogos.style.position = 'absolute';
        divFogos.style.visibility = 'hidden';
        divFogos.style.zIndex = 1000;
        divFogos.style.backgroundColor = 'aliceblue';
        divFogos.style.borderWidth = '3px';
        divFogos.style.borderStyle = 'ridge';
        divFogos.style.borderRadius = '10px';
        divFogos.style.boxShadow = '5px 5px 10px Silver';
        divFogos.style.padding = '4px';
        document.body.appendChild(divFogos);
    }
    W.map.events.register("mousemove", W.map, function(e) {
        hideAlertPopup();
        var position = this.events.getMousePosition(e);
        var lmaoLayer = checkLayerNum();
        if(W.map.layers[lmaoLayer].features.length > 0){
            var alertFeatures = W.map.layers[lmaoLayer];
            for(var j = 0; j < W.map.layers[lmaoLayer].features.length; j++){
                var alertX = alertFeatures.features[j].attributes.pixel.x;
                var alertY = alertFeatures.features[j].attributes.pixel.y;
                if(FogosAlerts_Layer.getVisibility() === true && position.x > alertX - 16 && position.x < alertX + 16 && position.y > alertY - 19 && position.y < alertY + 19){
                    showAlertPopup(alertFeatures.features[j], alertX, alertY);
                }
            }
        }
    });
    W.map.events.register("zoomend", null, getFogosAlerts);
    W.map.events.register("moveend", null, getFogosAlerts);
}